import React from "react";

import { Props } from "./types";
import * as Styled from "./style";

import FunkRecords from "../../assets/test.png"

const Banner = ({}: Props) => {
  return (
     <Styled.MainBanner> 
      <Styled.Description backgroundImage={[`url(${FunkRecords})`, `url(${FunkRecords})`, `url(${FunkRecords})`]}>
      </Styled.Description>
     </Styled.MainBanner>
  ) 
};

export default Banner;
